import React from 'react';
import { Link } from "react-router-dom";
import 'bootstrap/dist/css/bootstrap.min.css';
import '../style/Zipcode.css';

export default class ZipcodeRow extends React.Component {
	constructor(props) {
		super(props);
	}

	render() {
		return (
			<div className="card">
				<img className="pic" src={this.props.pic}></img>
				<p className="listing_id">{this.props.listing_id}</p>
				<Link to={{ pathname: `listing/${this.props.listing_id}` }}>{"ListingID: " + this.props.listing_id}</Link>
				<p className="name">{"Name: " + this.props.name}</p>
				<p className="guests">Guests: {this.props.guests}</p>
				<p className="distance">Distance: {this.props.distance}</p>
				<p className="price">Price: {this.props.price}</p>
				<p className="bedrooms">Bedrooms: {this.props.bedrooms}</p>
			</div>
		);
	}
}
